const superscript = {0:"",1:"\xb9",2:"\xb2",3:"\xb3",4:"",5:"",6:"",7:"",8:"",9:"","+":"","-":"",a:"",b:"",c:"",d:"",e:"",f:"",g:"",h:"",i:"",j:"",k:"",l:"",m:"",n:"",o:"",p:"",r:"",s:"",t:"",u:"",v:"",w:"",x:"",y:"",z:""};

const createSubScriptContent = () =>
{
    /** Create elements */
    const container = document.createElement('div'),
        textInput = document.createElement('textarea'),
        textOutput = document.createElement('textarea'),
        convertButton = document.createElement('div');

    /** Add classes to elements */
    container.classList.add('convertContainer');
    convertButton.classList.add('convertButton');

    /** Add attributes to textboxes */
    [textInput, textOutput].forEach((element, index) =>
    {
        element.setAttribute('id', `text-${index === 0 ? 'input' : 'output'}`);
        container.appendChild(element);

        if(index === 1)
        {
            element.setAttribute('readonly', '');
        }
    });

    /** Set button text */
    convertButton.textContent = 'Convert';

    /** Add button click listener */
    convertButton.addEventListener('click', () =>
    {
        const textInputValue = textInput.value;

        let output = '';

        for(let i = 0; i < textInputValue.length; i++)
        {
            const currentChar = textInputValue.charAt(i);

            output += (superscript.hasOwnProperty(currentChar)
                ? superscript[currentChar]
                : currentChar);
        }

        textOutput.value = output;
    });

    /** Add button to container */
    container.appendChild(convertButton);

    return container;
};

/**
 * Creates (or updates) an overlay with the set content
 */
const createOverlay = (...content) =>
{
    let overlayContainer = document.querySelector('div.overlayContainer');

    if(!overlayContainer)
    {
        /** If overlay container does not already exist */
        overlayContainer = document.createElement('div');
        overlayContainer.classList.add('overlayContainer');
    } else {
        /** Overlay container already exists, clear children */
        overlayContainer.innerHTML = '';
    }

    /** Add element nodes to container */
    content.forEach((node) => overlayContainer.appendChild(node));

    /** Prepend container to body */
    document.body.prepend(overlayContainer);

    return overlayContainer;
};

/**
 * Removes the overlay
 */
const removeOverlay = () =>
{
    let overlayContainer = document.querySelector('div.overlayContainer');

    return overlayContainer.remove();
};

/**
 * Copies text to the clipboard
 */
const clipboardCopy = (text) =>
{
    if(!navigator.clipboard)
    {
        const textArea = document.createElement('textarea');
        textArea.value = text;

        textArea.style.top = '0';
        textArea.style.left = '0';
        textArea.style.position = 'fixed';

        document.body.appendChild(textArea);
        textArea.focus();
        textArea.select();

        try
        {
            const successful = document.execCommand('copy');

            console.log('clipboardCopy', {
                type: 'Fallback',
                successful: successful
            });
        } catch (err) {
            console.log('clipboardCopy', {
                type: 'Fallback',
                successful: false
            });
        }

        document.body.removeChild(textArea);

        return;
    }

    navigator.clipboard.writeText(text).then(() =>
    {
        console.log('clipboardCopy', {
            type: 'async',
            successful: true
        });
    }).catch(() =>
    {
        console.log('clipboardCopy', {
            type: 'async',
            successful: false
        });
    });
};

